import React from 'react'
import Auxiliary from '../../hoc/Auxiliary'
import Toolbar from './Navigation/Toolbar/Toolbar'
import './Layout.css'
const Layout = (props) => {
   return (
   <Auxiliary >
    <div>
        <Toolbar/>
    </div>
    <main className="Content">
        {props.children}
    </main>
    </Auxiliary>
   )}

export default Layout
